import React from 'react';
import './App.css';
import KommunicateChat from './chat';

function App() {
  return (
    <div className="App">
      <div className="container-fluid">
       <KommunicateChat/>   

        <nav class="navbar">
          <a class="navbar-brand">
            <img src="../logo.svg" width="30" height="30" />
          </a>
        </nav>
      </div>
    </div> 

  );
}

export default App;
